@geerew which provider are you using for webdav?

 "Wed May 17 15:31:58 UTC 2017" looks like [UnixDate format](https://play.golang.org/p/f0Il6VJ_BFz) which isn't a valid time format for webdav.

I can add a parser in for it though easily enough.

@geerew can you try this and see if it fixes the problem please?

https://pub.rclone.org/v1.39-029-g2dd1fef5-webdav-time%CE%B2/

